import React from 'react'
import allblog from '../blogdata/blog.json'

const AllPosts = () => {
    //console.log(allblog)
    return (
        <div>
            {
                allblog.data.map((items, i) => {
                    return (
                        <>


                            <div class="box alt">
                                <div class="row gtr-50 gtr-uniform">
                                {
                allblog.data.map((items, i) => {
                    return (
                        <>
                                    <div class="col-4 blog-post">
                                        <div class="header-thumbnail">
                                            <a class="blog__img" href="">
                                                <img width="300" height="146" src={items.blogImage} /> </a>
                                        </div>
                                        <div class="entry-header blog__content">
                                            <div class="date_title">
                                                <div class="post-meta mt-15">
                                                    <a href="#"><img src={items.blogImage} alt="blogs" /></a>
                                                </div>
                                                <div class="post_date_title">
                                                    <a href="https://www.coruscatesolution.com/category/app-development/">{items.blogCategory}</a> <div class="inner_postmeta">
                                                        <span class="date_val">{items.postedOn}</span>

                                                    </div>
                                                </div>
                                            </div>
                                            <a href="https://www.coruscatesolution.com/generate-clean-code/"><h2 class="blog-title mt-15">{items.blogTitle}</h2></a>


                                        </div>
                                    </div>
</>
                    )
                })
            }

                                </div>
                            </div>
                        </>
                    )
                })
            }
        </div>
    )
}

export default AllPosts
